import {Button, Typography} from '@material-ui/core';
import { makeStyles } from '@material-ui/core/styles';
import slider2 from '../../Assets/Images/slider2.jpg';

const useStyles = makeStyles(() => ({
   root: {
    zIndex: 20,
    position: 'absolute',
   }
  }));
 const MensDetails = () => {
    const classes = useStyles();
    return <Grid container item xs={12} spacing={4} className={classes.gridCss} justify='center'>
				<Grid item xs={12} className={classes.contentCss}>Men's Casusal</Grid>
				<Grid item xs={6} style={{}}><Button className={classes.btnCss} size='large'>Shop Collection</Button></Grid>
		</Grid>
}
export default MensDetails;
